  false,\n\t\"url\": null,\n\t\"notes\": \"Packet of information from the Colorado
  Cattlemen's Association concerning the 1992 lawsuit filed against the Monte Vista
  National Wildlife Refuge. The suit was filed by the National Audubon Society, The
  Wilderness Society, and The defenders of Wildlife and alleges that livestock grazing
  on the refuge is destroying duck nesting habitat. The suit is based primarily on
  a study done by the Colorado Cooperative Fish and Wildlife Research Unit in Fort
  Collins. This packet contains (1) News article from the Wilderness Society, (2)
  Background information on a coalition lawsuit challenging harmful activities on
  the National Wildlife Refuge System, prepared by the National Audubon Society, (3)
  Official complaint for declaratory judgement and injunctive relief, and (4) Land
  management history for Monte Vista National Wildlife Refuge in 1989 and 1992.\",\n\t\"owner_org\":
